import React from "react";
import { useNavigate } from 'react-router-dom';
import './Settings.css'


function Settings(props){
    const navigation = useNavigate();
    function handleLogout(){
        navigation("/LogIn");

    }
    return (
        <div className="dropdown">
        <button className="dropdown-toggle" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
            &#9776; {/* This is the Unicode for the three horizontal lines (hamburger icon) */}
        </button>
        <div className="dropdown-menu" aria-labelledby="dropdownMenuButton">
            <a className="dropdown-item" href="#logout" onClick={handleLogout}>
            Log Out
            </a>
        </div>
        </div>
    );

}

export default Settings
